// import Todo from "./Todo"

function Todos ( {todos} ) {
    todos.map( todo => 
    {
        return (
            <div className="todo" key={todo.todoId}>
                {todo.todoText}
            </div>
        )
        // console.log("text => " + todo.todoText);
        // console.log("Id   => " + todo.todoId);
    })
}

export default Todos
